
DROP TABLE IF EXISTS chennaizones CASCADE;

CREATE TABLE chennaizones ( "ogc_fid" SERIAL, "wkb_geometry" GEOMETRY, CONSTRAINT "chennaizones_pk" PRIMARY KEY ("ogc_fid") );

CREATE INDEX "chennaizones_wkb_geometry_geom_idx" ON chennaizones USING GIST ("wkb_geometry");
ALTER TABLE chennaizones ADD COLUMN "id" NUMERIC(10,0);
ALTER TABLE chennaizones ADD COLUMN "zone number" NUMERIC(10,0);
ALTER TABLE chennaizones ADD COLUMN "area name" VARCHAR(100);
COMMIT;
